// src/WebSocketTag.js
import React from 'react';
import  useWebSocket  from 'react-use-websocket';

const TagForm = () => {
  const { lastMessage, readyState } = useWebSocket('ws://localhost:8082');

  const tag = lastMessage ? JSON.parse(lastMessage.data).tag : '';

  return (
    <div>
      <h1>WebSocket Tag:</h1>
      <p>Connection Status: {readyState === 1 ? 'Connected' : 'Disconnected'}</p>
      <p>{tag}</p>
    </div>
  );
};

export default TagForm;
